function appendBlockedUsers(a){for(var b=0;b<a.length;b++){var c=a[b];$(".blockedUsersList").append("<li>"+c+"</li>")}}function getBlockedUsers(){$.ajax({type:"GET",url:"/admin/blockedUsers",success:appendBlockedUsers})}function blockUser(a){var b={userName:a};$.ajax({type:"POST",url:"/admin/blockUser",data:b,success:function(a){console.log("Blocked user: ",a)}})}function unblockUser(a){var b={userName:a};$.ajax({type:"PUT",url:"/admin/unblockUser",data:b,success:function(a){console.log("Unblocked user: ",a)}})}function getFlaggedMessages(){$.ajax({type:"GET",url:"/admin/flaggedMessages",success:function(a){console.log("Got all Flagged messages: ",a)}})}function getFlaggedComments(){$.ajax({type:"GET",url:"/admin/flaggedComments",success:function(a){console.log("Got all Flagged comments: ",a)}})}function deleteMessage(a){$.ajax({type:"DELETE",url:"/message/"+a,success:function(a){console.log("Got all Flagged messages: ",a)}})}function deleteComment(a){$.ajax({type:"DELETE",url:"/message/comment/"+a,success:function(a){console.log("Deleted comment: ",a)}})}function viewFeedback(){$.ajax({type:"GET",url:"/admin/allFeedback",success:function(a){console.log("Got all feedback: ",a)}})}$(document).ready(function(){console.log("Jquery is working!"),getBlockedUsers(),unblockUser("ekimlinger@gmail.com"),getFlaggedMessages(),getFlaggedComments(),viewFeedback()});